import Hero from "../components/Hero";
import Navbar from "../components/Navbar"

function Home(){
    return(
        <>
        <Navbar /> 
        <Hero 
        cName="hero"
        heroImg = "https://images.unsplash.com/photo-1603827457577-609e6f42a45e?auto=format&fit=crop&q=60&w=500&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8OHx8ZG9uYXRpb258ZW58MHwwfDB8fHwy"
        title = "Don't wait for a better world; make it."
        text = "Be a part of something greater"
        buttonText ="Donate now"
        url="/"/>
        </>
    )
}

export default Home;
